jenkins:
  agentProtocols:
    - "JNLP4-connect"
    - "Ping"
  authorizationStrategy:
    loggedInUsersCanDoAnything:
      allowAnonymousRead: false
  clouds:
    - computeEngine:
        cloudName: "gce"
        configurations:
          - bootDiskAutoDelete: true
            bootDiskSizeGb: 10
            bootDiskSizeGbStr: "10"
            bootDiskSourceImageName: "https://www.googleapis.com/compute/v1/projects/jenkins-project-388812/global/images/jenkins-agent-1685899060"
            bootDiskSourceImageProject: "jenkins-project-388812"
            bootDiskType: "https://www.googleapis.com/compute/v1/projects/jenkins-project-388812/zones/us-central1-a/diskTypes/pd-ssd"
            description: "Ubuntu agent"
            javaExecPath: "java"
            labelSet:
              - name: "agent"
            labelString: "agent"
            labels: "agent"
            launchTimeoutSeconds: 300
            launchTimeoutSecondsStr: "300"
            machineType: "https://www.googleapis.com/compute/v1/projects/jenkins-project-388812/zones/us-central1-a/machineTypes/n1-standard-1"
            mode: NORMAL
            namePrefix: "agent"
            networkConfiguration:
              autofilled:
                network: "https://www.googleapis.com/compute/v1/projects/jenkins-project-388812/global/networks/default"
                subnetwork: "https://www.googleapis.com/compute/v1/projects/jenkins-project-388812/regions/us-central1/subnetworks/default"
            numExecutors: 1
            numExecutorsStr: "1"
            preemptible: true
            region: "https://www.googleapis.com/compute/v1/projects/jenkins-project-388812/regions/us-central1"
            retentionTimeMinutes: 6
            retentionTimeMinutesStr: "6"
            runAsUser: "jenkins"
            serviceAccountEmail: "jenkins-agent@jenkins-project-388812.iam.gserviceaccount.com"
            zone: "https://www.googleapis.com/compute/v1/projects/jenkins-project-388812/zones/us-central1-a"
        credentialsId: "jenkins-project"
        instanceCapStr: "2"
        instanceId: "51676b76-2495-4598-aa09-6a1ce254f0a6"
        projectId: "jenkins-project-388812"
  crumbIssuer:
    standard:
      excludeClientIPFromCrumb: true
  disableRememberMe: false
  disabledAdministrativeMonitors:
    - "jenkins.diagnostics.RootUrlNotSetMonitor"
  labelAtoms:
    - name: "agent"
    - name: "built-in"
  markupFormatter: "plainText"
  mode: NORMAL
  myViewsTabBar: "standard"
  numExecutors: 2
  primaryView:
    all:
      name: "all"
  projectNamingStrategy: "standard"
  quietPeriod: 5
  remotingSecurity:
    enabled: true
  scmCheckoutRetryCount: 0
  securityRealm:
    local:
      allowsSignup: false
      enableCaptcha: false
      users:
        - id: "samuel"
          name: "monrunflash"
          properties:
            - "apiToken"
            - "favorite"
            - "myView"
            - preferredProvider:
                providerId: "default"
            - "timezone"
            - mailer:
                emailAddress: "samue.coronil@tajamar365.com"
        - id: "sergioaten"
          name: "sergioaten"
          properties:
            - "apiToken"
            - "favorite"
            - preferredProvider:
                providerId: "default"
            - mailer:
                emailAddress: "sergio_10_96@hotmail.es"
        - id: "user"
          name: "user"
          properties:
            - "apiToken"
            - "myView"
            - "timezone"
            - "mailer"
            - "favorite"
            - preferredProvider:
                providerId: "default"
  slaveAgentPort: -1
  updateCenter:
    sites:
      - id: "default"
        url: "https://updates.jenkins.io/update-center.json"
  views:
    - all:
        name: "all"
  viewsTabBar: "standard"
globalCredentialsConfiguration:
  configuration:
    providerFilter: "none"
    typeFilter: "none"
security:
  apiToken:
    creationOfLegacyTokenEnabled: false
    tokenGenerationOnCreationEnabled: false
    usageStatisticsEnabled: true
  gitHooks:
    allowedOnAgents: false
    allowedOnController: false
  gitHostKeyVerificationConfiguration:
    sshHostKeyVerificationStrategy: "knownHostsFileVerificationStrategy"
unclassified:
  bitbucketEndpointConfiguration:
    endpoints:
      - bitbucketCloudEndpoint:
          enableCache: false
          manageHooks: false
          repositoriesCacheDuration: 0
          teamCacheDuration: 0
  buildDiscarders:
    configuredBuildDiscarders:
      - "jobBuildDiscarder"
  fingerprints:
    fingerprintCleanupDisabled: false
    storage: "file"
  gitHubConfiguration:
    apiRateLimitChecker: ThrottleForNormalize
  gitHubPluginConfig:
    hookUrl: "http://jenkins.gcp.sergioatenciano.es/github-webhook/"
  junitTestResultStorage:
    storage: "file"
  location:
    adminAddress: "address not configured yet <nobody@nowhere>"
  mailer:
    charset: "UTF-8"
    useSsl: false
    useTls: false
  pollSCM:
    pollingThreadCount: 10
  scmGit:
    addGitTagAction: false
    allowSecondFetch: false
    createAccountBasedOnEmail: false
    disableGitToolChooser: false
    hideCredentials: false
    showEntireCommitSummaryInChanges: false
    useExistingAccountWithSameEmail: false
tool:
  git:
    installations:
      - home: "git"
        name: "Default"
  mavenGlobalConfig:
    globalSettingsProvider: "standard"
    settingsProvider: "standard"